import React from "react";
import { useNavigate } from "react-router-dom";

const ToLastPage = () => {
    const navigate = useNavigate();
    const goBack = () => {
        navigate(-1);
    };

    return (
        <div>
            <button
            onClick={goBack}
            className="z-20 p-4 bg-red-500">
                Back
            </button>
        </div>
    )
}

export default ToLastPage;
